import React from 'react';
import './HeroPhone.css';
import phoneImage from '../assets/logo.png';
import phoneImage2 from '../assets/logo2.png';

const HeroPhone = () => {
  return (
    <div className="phone-container">
      <div className="hover-image-container">
        <div className="hover-transition-box">
          <img src={phoneImage2} alt="Hover Image" className="hover-img" />
          <span className="hover-text">Join</span>
        </div>
      </div>

      <div className="card">
        <div className="btn1"></div>
        <div className="btn2"></div>
        <div className="btn3"></div>
        <div className="btn4"></div>

        <div className="card-int">
          <div className="hello">
            <img src={phoneImage} alt="Phone Display" className="default-image" />
            <span className="hidden">Hello<br />User!!</span>
          </div>
        </div>

        <div className="top">
          <div className="camera">
            <div className="int"></div>
          </div>
          <div className="speaker"></div>
        </div>
      </div>

      <img src={phoneImage} alt="Bottom Companion" className="bottom-img" />
    </div>
  );
};

export default HeroPhone;
